import React, { useState, useEffect } from 'react';
import './App.css';

function App() {
  const [data, setData] = useState();
  //connecting to server
  useEffect(() => {
    fetch('http://localhost:3000/')
      .then((res) => res.json())
      .then(
        (result) => {
          setData(result);
        },
        (error) => {}
      );
  }, []);
  return <div></div>;
}

export default App;
